  "title": {
    "nb": "Jordsmonn - Jordkvalitet"
  },
  "description": {
    "nb": "Kartlaget jordkvalitet i datasettet jordsmonn viser en vurdering av jordegenskaper som er viktig for den agronomiske bruken av jorda, samt jordbruksarealets hellingsgrad. Jordkvalitetskartet er beregnet uavhengig av klima og forutsetter at jorda er drevet i henhold til god agronomisk praksis.\n\nRundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt. Hovedvekten av det kartlagte området finnes på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt."
  },
