  "title": {
    "nb": "Beitebruk - Sau sleppt på beite"
  },
  "description": {
    "nb": "Kartlag i datasettet Beitekart som viser antall sau sleppt på beite i beiteområder til organiserte beitelag. Kartlaget er fremstilt i målestokk 1:50 000 med kobling til registeret Organisert beitebruk hos Statens Landbruksforvaltning. Egenskap som skal brukes til å fremstille kartlaget heter ANTALL_SAU. Datasettet lastes ned for hele landet."
