  "title": {
    "nb": "Jordsmonn - Dreneringsforhold"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser dreneringsforhold uavhengig av grøftetilstanden. Et fungerende grøftesystem vil kunne tømme de største porene for vann slik at luft kan trenge ned i jorda. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter JR_DREN. Areal i kvadratmeter er oppført under AREA_C."
  },
