  "title": {
    "nb": "Arealressurskart - FKB-AR5 - Skogbonitet"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR5 som viser produksjonsevne/ bonitet i skogareal i målestokk 1:5000. Datasettet dekker alle områder under skoggrensen. Datasettet er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. AR5 er avledet fra tidligere markslag i Økonomisk kartverk.Skogbonitet er et mål for arealets evne til å produsere trevirke.Egenskap/kolonne som skal brukes til å fremstille kartlaget heter ARSKOGBON. Areal mindre enn to dekar blir vanligvis ikke skilt ut som egen figur. Jordbruksareal skilles ut ned til 0,5 dekar. Kravet for stedfestingsnøyaktighet er to meter. Areal i kvadratmeter er oppført under AREA_C. Kommunene har ansvar for kontinuerlig ajourhold. Skog og landskap gjør periodisk ajourhold hvert 3. år. Data lastes ned kommunevis."
  },
