  "title": {
    "nb": "Dyrkbar jord"
  },
  "description": {
    "nb": "Landsdekkene datasett som viser arealer som ved oppdyrking kan settes i stand slik at de vil holde kravene til fulldyrka jord og som holder kravene til klima og jordkvalitet for plantedyrking. Tidligere fulldyrka arealer som for eksempel er grodd igjen til skog er lagt inn, mens områder som er bygd ned eller dyrket opp er tatt ut. Datasettet dekker i all hovedsak alt landareal under tregrensa. Dyrkbar jord kan være registrert på arealtypene overflatedyrka jord, innmarksbeite, skog, åpen fastmark og myr.\n\nDyrkbar jord er også en egenskap i de generaliserte arealressurskartene i målestokk 1:50000 (AR50) og 1:250000 (AR250)."
  },
