  "title": {
    "nb": "Jordsmonn - Erosjonsrisiko"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser i hvilken grad det er risiko for at jordpartikler blir revet løs og transportert bort av vann fra et areal når dette høstpløyes. Erosjonsrisiko deles inn i fire klasser, og faktorer som nedbør, jordas helning, vegetasjon, snø og tele er av betydning for risikoen. Egenskapen/kartlaget inneholder ikke data dersom det er gjennomført forenklet kartlegging (se egenskapen \"METODE\")."
  },
  "descriptionFormatted": {
